-- Get gem type from item ID
function RaiderCheck_GetGemTypeFromItemId(itemID)
	return RaiderCheck_GemItemToType[itemID]
end

-- Get gem priority from item ID
function RaiderCheck_GetGemPriorityFromItemId(itemID)
	local gemType = RaiderCheck_GemItemToType[itemID]
	if not gemType then
		return 0
	end

	local priorities = {
		["Донатные"] = 7,
		["ННРБК"] = 6,
		["НРБК"] = 5,
		["РБК+"] = 4,
		["РБК"] = 3,
		["ЛК"] = 2,
		["БК"] = 1,
	}

	return priorities[gemType] or 0
end

-- Debug: Get all unknown gems logged by the addon
function RaiderCheck_GetUnknownGems()
	if not RaiderCheck_UnknownGems or #RaiderCheck_UnknownGems == 0 then
		print("|cFF00FF00[RaiderCheck]|r Неизвестных самоцветов не найдено")
		return
	end

	print("|cFFFFFF00[RaiderCheck] Список неизвестных самоцветов:|r")
	for i, gem in ipairs(RaiderCheck_UnknownGems) do
		print(
			string.format(
				"%d. ID: %d | Игрок: %s | Слот: %d | Timestamp: %s",
				i,
				gem.gemID,
				gem.player,
				gem.slot,
				tostring(gem.timestamp)
			)
		)
		if gem.itemLink then
			print("   " .. gem.itemLink)
		end
	end
	print("|cFFFFFF00Всего записей:|r " .. #RaiderCheck_UnknownGems)
end

-- Debug: Clear unknown gems log
function RaiderCheck_ClearUnknownGems()
	RaiderCheck_UnknownGems = {}
end

-- Initialize unknown gems storage
RaiderCheck_UnknownGems = {}

-- Add unknown gem to log (with deduplication)
function RaiderCheck_AddUnknownGem(itemId, itemName, itemLink, slotName, playerName)
	if not itemId then
		return
	end

	-- Check if already logged
	for _, gem in ipairs(RaiderCheck_UnknownGems) do
		if gem.itemId == itemId then
			return false -- Already exists
		end
	end

	-- Add new unknown gem
	table.insert(RaiderCheck_UnknownGems, {
		itemId = itemId,
		itemName = itemName or "Unknown",
		itemLink = itemLink,
		slotName = slotName,
		playerName = playerName,
		timestamp = time(),
	})

	return true -- New gem added
end
